CREATE DEFINER=`root`@`localhost` PROCEDURE `AllUsageByTimespan`(startDate varchar(45), endDate varchar(45))
BEGIN


     SELECT 
 		 firstname AS 'שם פרטי', 
 		 lastname AS 'שם משפחה',
 		 UserName AS 'שם משתמש', 
         License AS 'מספר רשיון',
         PID AS 'תעודת זהות',
         Field1 AS 'מספר עובד',
         Field2 AS 'מקצוע',
         CASE WHEN U.IsDeleted THEN 'כן' ELSE 'לא' END AS '?משתמש מחוק',
 		 CASE WHEN MT.id = 1 THEN 'אנמנזה' WHEN MT.id = 2 THEN 'בדיקה גופנית' END AS 'סוג שימוש',
 		 COUNT(savetime) AS 'סהכ'
 	FROM 
 		qx.User U
 		CROSS JOIN qx.ModuleType MT 
 			ON 	UserName NOT IN ('Learning', 'Moosh', 'admin', 'Test', 'doctor', 'doctor1', 'boiman_a', 'elami_m', 'qx', 'qxx', 'qx1', 'qx2')
 		LEFT OUTER JOIN qx.history H 
 			ON 	MT.ID = H.ModuleID AND 
 				H.UserID = U.ID AND 
 				H.savetime BETWEEN startDate AND endDate
 	GROUP BY
 		U.ID, MT.ID;


END ;;
DELIMITER ;
